import React, { Component } from 'react';
import Ninjas from './Ninjas';
import AddNinja from './AddNinja';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      ninjas: [
        { name: 'Ryu', age: 30, belt: 'black', id: '1123afdasdf' },
        { name: 'Ken', age: 20, belt: 'yellow', id: '2shgsher334' },
        { name: 'Lee', age: 30, belt: 'blue', id: '3234dfhfghj' },
      ],
    };
  }
  render() {
    return (
      <div className="App">
        <h1>My first react App</h1>
        <p>Welcome</p>
        <Ninjas ninjas={this.state.ninjas} />
      </div>
    );
  }
}

export default App;
